export function getVelocityData() {
    return fetch('http://127.0.0.1:8000/velocity/users', {
        method: 'GET',
        headers: {
            accept: 'application/json',
        },
        }).then(resp => resp.json())
}

export function getHistoricalData() {
    return fetch('http://127.0.0.1:8000/breakdown', {
        method: 'GET',
        headers: {
          accept: 'application/json',
        },
      }).then(resp => resp.json())
}
